import React, { useState } from 'react';
import IconButton from '@mui/material/IconButton';
import { getRandomTourismInfo } from '../utils/tourismInfo';
import { getRandomImageUrl } from '../utils/image';

const RandomInfoButton = () => {
  const [info, setInfo] = useState('');

  const handleClick = () => {
    setInfo(getRandomTourismInfo());
  };

  const randomImageUrl = getRandomImageUrl();

  return (
    <>
      <IconButton aria-label="random info" onClick={handleClick}>
        <img src={randomImageUrl} alt="random icon" />
      </IconButton>
      {info && <p>{info}</p>}
    </>
  );
};

export default RandomInfoButton;
